config.formatModuleScript:
(new UIFormListBehavior(module)).setNewItemFn(function(){

    return new MockDataTypeItem({
       name:"",
       description:"",
       content:"",
    });
}).addDataFormatter(function(data, item){

    return ObjectAppend_({}, item.toObject(), data);

}).setUpdateField('templatesData');

config.getItemListScript:
(new AjaxControlQuery(CoreAjaxUrlRoot, "get_configuration_field", {
		'widget': "reportTemplates",
		'field': "templatesData"
	})).addEvent('success',function(response){
            callback(response.value.map(function(item){
                return new MockDataTypeItem({
                    name:item.name,
                    description:item.description,
                    content:item.content,
                    mutable:true
                });

            }))
	}).execute();
